import styled from "styled-components";

export const HomeHeader = styled.header`
  width: 100%;
  height: 70px;
  border-bottom: solid #121214;
  display: flex;
  align-items: center;
  justify-content: space-around;

  button {
    width: 3%;
    height: 32px;
    border: none;
    border-radius: 5px;
  }
`;

export const UserInfo = styled.div`
  border: solid gray;
`;
